create table mqtt_sensor
(
    sensor_id int auto_increment
        primary key,
    light     int       null,
    light2    int       null,
    volt      double    null,
    volt1     double    null,
    volt2     int       null,
    timestamp timestamp null,
    temp      int       null,
    temp1     int       null,
    temp2     int       null,
    C1        int       null,
    C2        int       null,
    C3        int       null
)
    comment '传感器数据';

